export async function getStaticProps() {
  return {
    props: {
      ssg: "statically computed at build-time.",
    },
  };
}

export async function getServerSideProps() {
  return {
    props: {
      ssr: "server side rendered.",
    },
  };
}

export default function Example({ ssr, ssg }) {
  return (
    <div>
      <div>This content is: {ssr}</div>
      <div>This content is: {ssg}</div>
    </div>
  );
}
